/**
This contract emulates the behavior of a price datafeed

 */
interface AggregatorV3Interface {

    function decimals()
    external
    view
    returns (
      uint8
    );

  function description()
    external
    view
    returns (
      string memory
    );

  function version()
    external
    view
    returns (
      uint256
    );

  // getRoundData and latestRoundData should both raise "No data present"
  // if they do not have data to report, instead of returning unset values
  // which could be misinterpreted as actual reported values.
  function getRoundData(
    uint80 _roundId
  )
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

}

/***
* @title Mock Data Feed - Price data feed emulation
* It provides random numbers between a range stated by 
* basePrice, variation and decimals
*                                     decimals
*       result= basePrice+variation*10
*
 */
contract MockDatafeed is AggregatorV3Interface{
    
    uint public basePrice; 
    uint8 _decimals;
    uint variation;

    /*** 
    * @param _basePrice Base price
    * @param __decimals Number of decimals used
    * @param _variation Variation margin
    * price=_initialPrice+random(0..._variation)
    */ 
    constructor(uint _basePrice, uint8 __decimals, uint _variation){
      _decimals=__decimals;
      basePrice=_basePrice;
      variation=_variation;
    }
    /***  Decimalsd
    * @return configured decimals
    */ 
    function decimals()
    external override
    view
    returns (
      uint8
    ){
        return _decimals;
    }

  function description()
    external override
    view
    returns (
      string memory
    ){
        return "Mock oracle";
    }


  function version()
    external override
    view
    returns (
      uint256
    ){
        return 2;
    }

    function getRoundData(
    uint80 _roundId
  )
    external override
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    ){
        return _getRound(_roundId);
    }

  function latestRoundData()
    public override
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    ){
        return _getRound(uint80(block.number));
    }

  function _random() public view returns(int256){
        // DO NOT USE THIS IN PRODUCTION!!!!!!!!
        uint256 random=uint(blockhash(block.number-1)) % uint(variation); 
         require(random>=0,"Random must be greater than 0");
         require(random<=variation,"Random must be lower than variation parameter");
        //return int(random);
        int256 result= int256(basePrice+random);
        require(result>=0,"Result must be greater than 0");
        int32 calculatedDecimals=int32(uint32(10)**uint32(_decimals));
        return (result * int256(calculatedDecimals));
    }

    function _getRound(uint80 id) public view  
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    )
    {
      roundId=id;
      answer=_random();
      startedAt=block.timestamp;
      updatedAt=block.timestamp;
      answeredInRound=id;
    }

    event roundData(uint80 roundId,int256 answer, uint256 startedAt, uint256 updatedAt,uint80 answeredInRound);
    function exec() public {
      (
        uint80 _roundId,
        int256 _answer,
        uint256 _startedAt,
        uint256 _updatedAt,
        uint80 _answeredInRound
      )=latestRoundData();
      emit roundData(_roundId, _answer, _startedAt, _updatedAt, _answeredInRound);

    }

}","keccak256":"0xe73fc43d01a86aed6ed9f6a4d38ed0c95efb1492807be9c8207b75d4fc7e2d52"}},"version":1}
